%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0434\u043e\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0432\u0438\u043d\u044b \u043e\u0431\u0432\u0438\u043d\u044f\u0435\u043c\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u044b \u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D0%BF%D0%B5%D1%87%D0%B0%D1%82%D0%BA%D0%B8_%D0%BF%D0%B0%D0%BB%D1%8C%D1%86%D0%B5%D0%B2\" class=\"mw-redirect\" title=\"\u041e\u0442\u043f\u0435\u0447\u0430\u0442\u043a\u0438 \u043f\u0430\u043b\u044c\u0446\u0435\u0432\">\u043e\u0442\u043f\u0435\u0447\u0430\u0442\u043a\u0438 \u043f\u0430\u043b\u044c\u0446\u0435\u0432<\/a> \u0441 \u043c\u0435\u0441\u0442\u0430 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f. <\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%A1%D0%B0%D0%BA%D0%B0%D1%80%D1%8C%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0421\u0430\u043a\u0430\u0440\u044c\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0421\u0430\u043a\u0430\u0440\u044c\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u044b\u0439 \u0440\u0435\u043a\u043e\u0440\u0434 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D1%8F_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0417\u0435\u043c\u043b\u044f (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0417\u0435\u043c\u043b\u0435<\/a> \u0432 \u0442\u0435\u043d\u0438. \u041e\u043d \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b 57.7 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B4%D1%83%D1%81_%D0%A6%D0%B5%D0%BB%D1%8C%D1%81%D0%B8%D1%8F\" title=\"\u0413\u0440\u0430\u0434\u0443\u0441 \u0426\u0435\u043b\u044c\u0441\u0438\u044f\">\u0432 \u0433\u0440\u0430\u0434\u0443\u0441\u0430\u0445 \u043f\u043e \u0426\u0435\u043b\u044c\u0441\u0438\u044e<\/a> \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D1%8C-%D0%90%D0%B7%D0%B8%D0%B7%D0%B8%D1%8F_(%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F)\" title=\"\u042d\u043b\u044c-\u0410\u0437\u0438\u0437\u0438\u044f (\u041b\u0438\u0432\u0438\u044f)\">\u042d\u043b\u044c-\u0410\u0437\u0438\u0437\u0438\u0438<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%BE%D0%B2%D0%BE-%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9\" title=\"\u0410\u0437\u043e\u0432\u043e-\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439\">\u0410\u0437\u043e\u0432\u043e-\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439<\/a> \u0440\u0430\u0437\u0434\u0435\u043b\u0451\u043d \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B4%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B0%D0%B9\" title=\"\u041a\u0440\u0430\u0441\u043d\u043e\u0434\u0430\u0440\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439\">\u041a\u0440\u0430\u0441\u043d\u043e\u0434\u0430\u0440\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u0420\u043e\u0441\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u0420\u043e\u0441\u0442\u043e\u0432\u0441\u043a\u0443\u044e \u043e\u0431\u043b\u0430\u0441\u0442\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0412\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u0435 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0432 \u0415\u0433\u0438\u043f\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%9F%D0%BE%D0%BB%D0%BE%C2%BB\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041f\u043e\u043b\u043e\u00bb\">\u0432\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u0435 \u0438\u043d\u0434\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B9%D0%B4%D0%B0%D1%80%D0%B0%D0%B1%D0%B0%D0%B4_(%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0425\u0430\u0439\u0434\u0430\u0440\u0430\u0431\u0430\u0434 (\u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e)\">\u0425\u0430\u0439\u0434\u0430\u0440\u0430\u0431\u0430\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0418\u043d\u0434\u0438\u0439\u0441\u043a\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0418\u043d\u0434\u0438\u0439\u0441\u043a\u043e\u043c \u043e\u043a\u0435\u0430\u043d\u0435<\/a>, \u0432 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0432\u043e\u0434\u0430\u0445 \u0441\u0443\u043b\u0442\u0430\u043d\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BC%D0%B0%D0%BD\" title=\"\u041e\u043c\u0430\u043d\">\u041e\u043c\u0430\u043d<\/a> \u0441\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0438\u0441\u044c \u043d\u0430 \u043f\u043e\u043b\u043d\u043e\u043c \u0445\u043e\u0434\u0443 \u0434\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BD%D0%BA%D0%B5%D1%80\" title=\"\u0422\u0430\u043d\u043a\u0435\u0440\">\u0442\u0430\u043d\u043a\u0435\u0440\u0430<\/a> \u0441 \u0433\u0440\u0443\u0437\u043e\u043c \u0441\u044b\u0440\u043e\u0439 \u043d\u0435\u0444\u0442\u0438: \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u00ab\u0424\u0435\u0440\u043d\u0430\u0439 \u0416\u0438\u043b\u044c\u0431\u0435\u0440\u00bb \u0438 \u043b\u0438\u0431\u0435\u0440\u0438\u0439\u0441\u043a\u0438\u0439 \u00ab\u041c\u0435\u043b\u0438\u043a\u0430\u00bb. \u041f\u043e\u0441\u043b\u0435 \u0441\u0438\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u0434\u0430\u0440\u0430 \u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0432\u0448\u0438\u0445 \u0437\u0430 \u043d\u0438\u043c \u0432\u0437\u0440\u044b\u0432\u043e\u0432 \u0438 \u043f\u043e\u0436\u0430\u0440\u0430 \u043e\u0431\u0430 \u043a\u043e\u0440\u0430\u0431\u043b\u044f \u0437\u0430\u0442\u043e\u043d\u0443\u043b\u0438. \u0422\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u043f\u0440\u0438\u0432\u0435\u043b\u0430 \u043a \u0433\u0438\u0431\u0435\u043b\u0438 21 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 \u0414\u0435\u043d\u044c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0\" title=\"\u0411\u0438\u043e\u043d\u0438\u043a\u0430\">\u0431\u0438\u043e\u043d\u0438\u043a\u0438<\/a> (\u0432 \u0421\u0428\u0410 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u0438\u043c\u043f\u043e\u0437\u0438\u0443\u043c).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u044b \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D1%8F%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%94%D0%BE%D0%BD%D0%B0%D1%82%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u04